import IProffisional from "../../types/IProfissional";
import Card from "./Card";

function Avaliacao({profissionais}: {profissionais: IProffisional[] | null}) {
    return (
        <section>
            {profissionais?.map((profissional) =>{
                return (
                    <Card profissional={profissional}/>
            )})}
        </section>
    )
}

export default Avaliacao;
